content:
헉,, 1등이다.
처음으로 댓글 남깁니다.
과정이 지저분해지지 않게 해달라는 말이 정말 마음에 와닿네요&lt;

난 왜 거절 아닌거 같지?
분명 재미없는 영화였는데 재미있었다고 말하는건 영민이랑 봐서 그랬다는거 아닌가?;;
내가 너무 긍정적인가 ㅋ

ㅋㅋㅋㅋ...
&quot;주여...용서 하소서&quot;
그 사람들이 항상 남의등에 칼 꽂으며 하는말 아닌가...

짠..한 기태씨
주말출근에 일도 많이하는데
녹차도 기다려;;;;;

이번화는 정말! 은혜로움이~~!!

강책임 &quot;들어오실래요?&quot;
지윤이 &#x27;꺄아~~&#x27; 
솔직한데 담백해서 너무 좋은 주인공들...
닮고 싶네요~

&quot;이럴줄알았음 많이말릴걸.....&quot;
가을이는 예전 부터 눈치채고있었나...
그래서 예전 통화에서 지윤이가 강책임에대해 이야기할때  &quot;그 사람이 너를 싫어하나보지&quot;라고 한건가..

보라머리가 뭘그리 잘못했다고 욕을욕을 ㅊㅁㅊㅁ 하는걸까? 여자들도 난친사귀다 헤어지자고 했는데 자꾸미련갖고 저러면 힘들지않은까? 마음이떠나면 정말 못만나는데 그럴게 미안해서 질질끌고 여지를 주는것이 더 못할짓아닐까?
쌍방합의항헤어지면 좋겠지만 대부분 어느한편이 마음이식어서 헤어지는거 라고 생각함
고로 재인이 조금은 네가지가 없어보이지만 젊을땐 그럴수있으니 난 이해해준다!&gt;&lt;

여자친구 있냐는 질문에

나?노아&lt;

이 멘트부터 짜게 식음... 뭐야. 어린거 티 겁나나...

&quot;지윤씨 같은 분이 저를 왜...&quot;
&quot;지윤씨는 제가 배우고 싶은 사람이에요&quot;
&quot;지윤씨- 좋아합니다.&quot;
키스하고 지윤이 바라보는 눈빛까지 ㅠㅠㅠㅠㅠㅠㅠㅠㅠ
제가 지윤이라도 다시 한 번 사랑하고 싶을 것 같네요
연애의 마법이 착각일지라도...

아 진짜 표정ㅋㅋㅋㅋ
=_= 이게 서로 사랑 고백하고 있는 씬에서의 표정이라니ㅋㅋㅋㅋ 진짜 너무 참신해서 너무 귀엽잖아요~
=_=;

동생 발언 충격 하지만 한화만에 번복
강책임 너 ,, 증말 ,, 앙큼 ,, 하 개좋아
글고 조교님 존잘;;

하 진짜 조교 오빠 얼굴보고 
연애 결혼 신혼 애까지 상상 다했다;;
신의 외모다.

강책임 너무 내 스타일인데
좀 답답하기도 해요 
너무 애태우는 스타일 ;;;

아 근데 약국갔을 때 강책임 상상가서 개웃기다

&quot;그.. 생리통이 심하면 어떤 약을 먹어야 할까요?&quot;
&quot;아 여자친구 분이요?&quot;
&quot;-_-?!;;&quot;
&quot;?&quot;
&quot;아.. 예.&quot;
